import React, { useState } from "react";
import "./App.css";

export const App = () => {
  const [todoText, setTodoText] = useState("");
  const [incompleteTodo, setIncompleteTodo] = useState(["fefe", "grr"]);
  const [completeTodo, setCompleteTodo] = useState([""]);

  const onChangeTodoText = (event) => setTodoText(event.target.value);

  const onClickCompleteButton = (index, todo) => {
    const newTodo = [...completeTodo, todo];
    setCompleteTodo(newTodo);
  };
  const onClickDeleteButton = () => {};

  return (
    <>
      <div className="todoAdd">
        <input
          placeholder="TODOを追加"
          value={todoText}
          onChange={onChangeTodoText}
        />
        <button>追加</button>
      </div>

      <div className="incompleteArea">
        <p>未完了のTODO</p>
        <ul>
          <li>
            {incompleteTodo.map((todo, index) => {
              return (
                <div key={todo} className="list-row">
                  <li>{todo}</li>
                  <button onClick={() => onClickCompleteButton(index, todo)}>
                    完了
                  </button>
                  <button onClick={() => onClickDeleteButton(index, todo)}>
                    削除
                  </button>
                </div>
              );
            })}
          </li>
        </ul>
      </div>

      <div className="complete-area">
        <p>完了したTODO</p>
        <ul>
          <li>
            {completeTodo.map((todp, index) => {
              return (
                <div key={todo} className="list-row">
                  <li>{todo}</li>
                  <button></button>
                </div>
              );
            })}
            <div className="list-row">
              <li>sss</li>
              <button>戻す</button>
            </div>
          </li>
        </ul>
      </div>
    </>
  );
};
